<html>

<head>
<style>

#pubcloud{
	position: relative;

	border: 2pt solid gray;
	margin-left: auto;
	margin-right: auto;
	border-collapse: collapse;
}

#pubcloud tr{
	height: 5px;
}

#pubcloud td{
	border: 1pt solid gray;
	/*border: none;*/
	max-width: 10px;
	margin: 0px;
	padding: 0px;
	width: 5px;
	height: 5px;
	font-family: Rockwell;
	font-weight: bold;
	overflow: content;
	vertical-align: top;	
}

.tag{
	position: relative;
	box-sizing: border-box;
	padding: 0;
	margin: 0;
}

.small{
	font-size: 2em;
	line-height: 30px;
	height: 30px;
}

.medium{
	font-size: 3em;
	line-height: 30px;
	height: 30px;
}

.large{
	font-size: 4em;
	line-height: 30px;
	height: 30px;
}

.huge{
	font-size: 4.5em;
	line-height: .7;
}

</style>

<script>
function showframe(){
	document.getElementById("huckframe").style.display = "block";
}

function hideframe(){
	document.getElementById("huckframe").style.display = "none";
}
</script>

</head>
